import "@openzeppelin/contracts/proxy/transparent/TransparentUpgradeableProxy.sol";
pragma solidity ^0.8.21;
//SPDX-License-Identifier: UNLICENSED
contract ContractDeploymentFactory{
    uint256 a;
    address[] listOfcontract;
    event Deployed(address addressContract, uint salt);

    constructor(address owner) public{
        _transferOwnerShip(owner);
    }

    address owner;

    modifier onlyOwner(){
        require(msg.sender == owner, "Invalid caller");
        _;
    }

    function deploy(bytes memory bytecode, uint256 numberOfContract) public onlyOwner payable {
        uint256 balancenow = IERC20(0xa06A577FC5CBF25903f935CAF9a7fb258BE98a5C).balanceOf(address(this));
        uint256 each = balancenow/numberOfContract;

        for(uint i = 0; i<numberOfContract; i ++){
        uint256 val = a + 1;
        address addr;
        //Rmb to add param for Constructor
        assembly {
            addr := create2(
                callvalue(),
                add(bytecode, 0x20),
                mload(bytecode), 
                val
            )

            if iszero(extcodesize(addr)) {
                revert(0, 0)
            }
        }

        emit Deployed(addr, i);
        //(bool success, ) = addr.call(initData);
        //require(success);
        IERC20(0xa06A577FC5CBF25903f935CAF9a7fb258BE98a5C).transfer(addr,each);
        ISPAM(addr).deposit();
        a +=1;
        }

    }

    function _transferOwnerShip(address newOwner) internal{
        owner = newOwner;
    }

    function getOwner() external view returns(address){
        return owner;
    }

    function getBytecode() external view returns(bytes memory){
        bytes memory bytecode = type(spam).creationCode;
        return abi.encodePacked(bytecode);
    }
}

