interface ISPAM{
    function deposit() external;
}
contract spam{
    address router = 0x3c7C58439aCA472501B7F6Ea52c83dBda47241Ac;
    address token = 0xa06A577FC5CBF25903f935CAF9a7fb258BE98a5C;
    function deposit() external{
        uint256 amount = IERC20(token).balanceOf(address(this));
        IERC20(token).approve(router, amount);
        uint256 poolID = IRouter(router).getPoolLength() - 1;
        IRouter(router).deposit(poolID, amount);
    }
}

